import React from 'react';
import {
  Link,
  Switch,
  Route,
} from 'react-router-dom';
import LinkedList from './linked-list.js';

function DSADefaultPage() {
  return (
    <h1>I'm a default page</h1>
  );
}

const dataStructures = [
  {
    "name": "Linked List",
    "route": "linked-list",
    "page": LinkedList,
  },
  {
    "name": "Hash Table",
    "route": "hash-table",
    "page": DSADefaultPage,
  },
];

export function DSLinks() {
  return (
    <>
      <h2>Data Structures</h2>
      <ul>
        { dataStructures.map(ds => {
          return (
            <li key={ds.route}>
              <Link to={`/data-structures/${ds.route}`}>
                {ds.name}
              </Link>
            </li>
          )
        })}
      </ul>
    </>
  );
}

export function DSRoutes() {
  return (
    <Switch>
      <Route exact path="/data-structures">
        <DSLinks />
      </Route>
      { dataStructures.map(ds => {
        const pagepath = `/data-structures/${ds.route}`;
        return (
          <Route key={pagepath} exact path={pagepath}>
            {ds.page}
          </Route>
        );
      })}
    </Switch>
  );
}
